			.dailyStars ul li span em.s5 {width:80px;}



			.zodiacMap { float:left; display:block; margin-top:8px; margin-bottom:10px; margin-left:5px; background: url(data:image/png;base64,%3D%3D) no-repeat; width:150px; height:190px; }



			#zodiacMap { width:150px; height:190px; }



			div#date2{ text-align:center; font-weight:bold; color: #fff; clear:both; background-color:#999; text-shadow:none; }

			
			li {border-top:0px solid !important; border-bottom:0px solid !important;}
			li.zodiacHead { margin-top:5px; margin-bottom:5px; float:right; }						li.zodiacHead a { font-size:10px; }

			.t1 { background-color:#fff; border-radius:3px; box-shadow:1px 1px 1px #ccc; width:100%; opacity:0.85;}

			



		</style>



	<table class="t1"><tr><td>



